import React from 'react';
import styled from 'styled-components';

const ScheduleContainer = styled.div`
  padding: 2rem;
  text-align: center;
`;

function Schedule() {
  return (
    <ScheduleContainer>
      <h2>Schedule Page</h2>
      <p>Here you can display the bus schedules, next arrival times, etc.</p>
    </ScheduleContainer>
  );
}

export default Schedule;
